import React, {useState} from 'react';
import Menu from '../../components/menu';

function Dashboard() {

    const [name, setName] = useState(localStorage.getItem('name'));

    const logout = () => {
        return (
            localStorage.clear(),
            window.location.href="/"
        );
    }

    return(
        <div>
            <h2>Dashboard</h2>
            Ola {name}
            <Menu />
            <a href="#" onClick={this.logout()}>Sair</a>
        </div>
    );
}

export default Dashboard;
